    "contracts/CGPTBurn.sol": {
      "content": "// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "hardhat/console.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/extensions/ERC20BurnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

/**
@title Burn
@dev A contract to Burn the tokens.
*/

contract CGPTBurn is Initializable, UUPSUpgradeable, OwnableUpgradeable {
    address public tokenAddress;

    function initialize(address _tokenAddress
    ) external initializer{
        __Ownable_init();
        __UUPSUpgradeable_init();
        require(tokenAddress == address(0), "Contract is already initialized");
        tokenAddress = _tokenAddress;   
    }

    /**
     * @dev Burn the tokens from contract
     * @param _amount The amount which needs to be burn.
     */
    function burnFunctionality(uint256 _amount) external {
        ERC20BurnableUpgradeable token = ERC20BurnableUpgradeable(tokenAddress);
        require(_amount <= ERC20Upgradeable(tokenAddress).balanceOf(address(this)), "Contract balance is not sufficent");
        token.burn(_amount);
    }

    /**
     * @dev Withdraws the tokens from the contract to the owner. Only the owner can access this function.
     * @param _to The address on which token will transfer.
     * @param _amount The amount which needs to be transfered.
     */
    function withdrawTokens(address _to, uint256 _amount) external onlyOwner {
        ERC20Upgradeable token = ERC20Upgradeable(tokenAddress);
        require(_amount <= token.balanceOf(address(this)), "Contract balance is not sufficent");
        require(token.transfer(_to, _amount), "Token transfer failed");
    }

    function _authorizeUpgrade(address) internal override onlyOwner {}
}"
